INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(36, 133, 7, 'Baked apples', 'Baked apples\n\nBaked apples are delicious and one of the most useful desserts. It is quite easy to prepare, but has many options. Yes, apples can be baked with honey, cheese, cinnamon, puff pastry.\n\nApples baked with honey\nApples - 2 pcs.\nHoney - 1 tbsp.\nCinnamon - 1 tsp.\nButter - 10 g\nWash the apples, cut in half. Remove from each half of the heart activity.\nPut the apples in a heat-resistant form. Sprinkle with cinnamon and pour honey.\n\nSpread a small piece of butter on top. Find the form with the foil apples and send in a preheated oven to 180 ° C for 30 minutes. At the same time it is necessary to check them further for readiness.\n\nYou can serve this apple with a scoop of ice cream and caramel.', 1655115539, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(37, 133, 2, 'Chicken strudel', 'Chicken strudel\r\n\r\n1. Defrost the dough according to the instructions on the package.\r\n\r\n2. Cut mushrooms and onions, salt and fry in a preheated pan with oil until golden. Let cool.\r\n\r\n3. Boil chicken fillet in salted water, cut into small cubes and add to mushrooms.\r\n\r\n4. Grate the cheese on a coarse grater, mix with mushrooms and chicken. Add sour cream.\r\n\r\n5. Roll out the dough thinly. Spread the filling along one side.\r\n\r\n6. Melt the butter, grease the dough around the filling.\r\n\r\n7. Wrap the dough into a roll, close the edges.\r\n\r\n8. Spread the strudel on a baking sheet covered with parchment. Grease with melted butter.\r\n\r\n9. Bake in a preheated 190 ° C oven for 30-40 minutes until ruddy crust.\r\n\r\nCut the strudel, spread it on plates and invite the family to the table!', 1655115636, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(38, 133, 8, 'Puff pastry cookies for children', 'Puff pastry cookies for children\r\n\r\n1. Defrost the dough according to the instructions on the package.\r\n\r\n2. Roll out into a layer 5 mm thick, sprinkle with cinnamon and sugar. Using a rolling pin, press cinnamon and sugar into the dough.\r\n\r\n3. Wrap the dough on both sides with a tube to the center. Cut into 1 cm thick pieces.\r\n\r\n4. Cover the pan with parchment paper, grease with butter. Spread the pieces of dough.\r\n\r\n5. Preheat the oven to 190 ° C. Bake the cookies for 15-18 minutes until golden. When the cake has cooled, sprinkle with powdered sugar.\r\n\r\nBon appetit!', 1655115706, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(39, 133, 8, 'Puff pastry with cheese and jam', 'Puff pastry with cheese and jam\r\n\r\n\r\n1. Beat cottage cheese with sugar and lemon juice.\r\n\r\n2. Defrost the dough according to the instructions on the package and roll out on a sheet of parchment in a rectangular layer 5 mm thick, 30x40 cm.\r\n\r\n3. Put the dough with the narrow side to you and mentally divide lengthwise into three parts. The left and right parts are cut into strips 1 cm wide at an angle of 45 °. The middle part should remain intact.\r\n\r\n4. Spread the cheese filling in the center, distribute a thin layer of jam or berries, grated with sugar. Add some fresh berries.\r\n\r\n5. Wrap part of the dough on the filling at the top and bottom. And then cover the filling with strips in turn on each side in the form of a braid.', 1655115799, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(40, 133, 8, 'Plum pie', 'Plum pie\r\n\r\n\r\nDefrost and roll out puff pastry TM \"Rud\". Cut off and set aside part of the dough to form the top.\r\nGrease the form with butter and carefully spread the dough. We form sides. Cut off the excess dough with kitchen scissors.\r\nWash the plums thoroughly, remove the stones and cut lengthwise into four pieces.\r\nSprinkle the dough with starch and spread it evenly on the surface.\r\nFill the form with the dough sliced ​​plums. Sprinkle generously with sugar and cinnamon.\r\nThe remaining dough is cut into thin long strips and make a braid on top of the cake.\r\nGrease the top with egg yolk.\r\nBake the cake at 180 ° C for 30 minutes. Remove the cake from the oven, sprinkle with powdered sugar.\r\nCut and enjoy!', 1655115875, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(41, 133, 2, 'Tomato gazpacho soup', 'Tomato gazpacho soup\r\n\r\n\r\nKnead the bread into several pieces and pour warm water for a couple of minutes. Remove the seeds from the pepper and peel the cucumber. Cucumbers, peppers and onions cut into large cubes. Garlic cut into slices. Cut the tomatoes into 4 pieces and scald with boiling water for a few minutes. Peel a squash, grate it and cut it into large pieces.\r\n\r\nPut all the vegetables in a saucepan. Add a few drops of tabasco, salt, vinegar, olive oil and soaked bread. Grind the whole mass with a blender. Pass the soup through a sieve so that no lumps remain in it. Put the soup in the refrigerator for 3 hours and pour into bowls. Garnish with finely chopped vegetables or croutons and serve cold.', 1655115941, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(42, 133, 5, 'Honey milkshakes', 'Honey milkshakes\r\n\r\nDmytro Humeniuk,\r\nPeel a banana, grate it and slice it. We leave some of the most beautiful for decoration.\r\nWe break chocolate into pieces. If the tile is more than 70 g, the remaining, rub on a grater. It will also be a decoration for a milkshake with banana and honey.\r\nPour bananas and chocolate into a blender, pour milk and beat until smooth.\r\nAdd honey and continue beating for another minute.\r\nPour the banana cocktail into glasses. Sprinkle with chocolate on top and decorate with banana slices.\r\nMilkshake with honey and banana is best served chilled.', 1655122234, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(43, 133, 5, 'Cocoa with chili peppers', 'Cocoa with chili peppers\r\n\r\n\r\nStage № 1\r\n\r\nPour the milk into a small saucepan and heat over low heat. No need to boil.\r\n\r\nStage № 2\r\n\r\nPour cocoa powder into a cup, mix with cinnamon and nutmeg. Add vanilla extract and water. Thoroughly mix all components until smooth.\r\n\r\nStage № 3\r\n\r\nRub chili peppers on a fine grater. Combine the pasty mixture and a pinch of chili with the milk and mix the cocoa well. Bring to a boil, add sugar or a teaspoon of honey. Strain and pour into a glass or cup.\r\n\r\nStage № 4\r\n\r\nRub dark chocolate on a fine grater and sprinkle with the finished drink.', 1655122297, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(44, 133, 6, 'Pumpkin salad recipe', 'Pumpkin salad recipe\r\n\r\n\r\nThe main thing in this dish is to properly bake the pumpkin to a golden-caramel color and prepare a spicy Harrissa sauce at home, although you can also buy it in the store. Pumpkin seeds do not need to be thrown away, if you bake it, you can decorate the finished dish with it, it will add a light crunchiness. Suitable for every day, but best for a holiday table or for a romantic dinner.\r\n\r\nFor a light spicy taste, at the beginning of cooking, add a little olive oil in a jar with sauce, stir, refrigerate. Then, remove the jar and add to the dressing only the oil soaked in hot sauce. The number of ingredients is calculated in 4 servings.', 1655123113, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(45, 133, 4, 'Charlotte with apples', '1. Cut apples into slices or cubes. Apples are better to take sour varieties.\r\n\r\n2. Beat eggs with sugar and 1 pinch of salt into a light thick mass. To make sure that the mass is already well beaten, draw a line with a whisk, if it remains visible for 1-2 seconds, and then spreads, the eggs with sugar are already well beaten. If it spreads immediately, you need to knock down more.\r\n\r\n3. Sift the flour into the egg-sugar mixture and gently stir with a spatula from the bottom up. Biscuit dough should be handled with care to keep it as light as possible.\r\n\r\n4. Line the form with parchment or grease with butter, sprinkle with flour. Pour ½ parts of the dough, lay out half of the sliced ​​apples, pour the dough on top and lay out the remaining apples. If you cut the apples into cubes, you can add them to the dough, mix gently and then lay out the whole mass in a baking dish.\r\n\r\n5. Bake for 25-30 minutes at a temperature of 180 degrees.', 1655123645, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(46, 133, 6, 'Salad marked onions and chicken', 'Salad with marked onions and chicken\r\n\r\nCut the chicken meat into pieces and fry until golden. If necessary, add salt and pepper.\r\nIn another pan, throw sliced ​​tomatoes, chili peppers, stew for 10 minutes. Add honey, salt, spices, chopped garlic, 3 minutes later add vinegar and turn off the heat.\r\nCut the onion into thin half-rings. Mix half a glass of warm water with sugar, salt and vinegar, pour the liquid over the onion and leave to cool completely.\r\nCut cucumbers into strips, chop greens. Combine meat, herbs, sauce.\r\nPut lettuce leaves on a plate, spread the meat with sauce, pickled onions, sprinkle with grated cheese and herbs. Garnish with slices of tomato.', 1655123723, );
INSERT INTO `posts` (`post_id`, `author_id`, `category`, `title`, `text`, `date`, `image`) VALUES
(47, 133, 8, 'Grated pie with jam', 'Combine soft butter, sugar and vanilla in a bowl. Grind them with a spoon.\r\nAdd chicken egg to butter-egg mixture. Beat with a mixer until creamy.\r\n\r\nThen add flour and baking powder. Flour should be introduced gradually, as needed. Mix everything with a mixer, and then switch to hand kneading - the result should be a soft and pliable dough.\r\n\r\nDivide the dough into two parts, which should be slightly frozen.\r\n\r\nLay out the baking dish with parchment paper. Rub the first part of the dough on a large grater on the bottom of the form. The sides of the cake can be formed from flagella of shortcrust pastry.\r\n\r\nNext, lay out the jam (it should not be too thin).\r\n\r\nOn top of the jam spread a second layer of grated on a large grater frozen dough. Send the form for 30 minutes in a preheated oven to 240 ° C (if the cake is thin - up to 200-220 ° C).\r\n\r\nThe finished cake should be allowed to cool slightly, and then cut into pieces.', 1655123787, );

